import React, { useState } from "react";

import "./Button.css";

const Button = (props) => {
  const [valid, setValid] = useState(props.isValid);
  if (!valid) {
    setValid(false);
  }
  return (
    <button
      type={props.type}
      className={`button ${!valid ? "" : "inactive"}`}
      onClick={props.onClick}
    >
      {props.children}
    </button>
  );
};

export default Button;
